      emo.unicodes = emo.codepoints.filter(c => !(0xd800 <= c && c <= 0xdfff));
      var charCodes = []; i = 0;
      while ((i < emo.key.length)) { charCodes.push(emo.key.charCodeAt(i)); i++; }
